INSERT INTO `airplane_type` VALUES (6,'Airbus A380',' Der Airbus A380 (umgangssprachlich auch \"Superjumbo\" als Steigerung von Jumbo-Jet, Airbus-interner Projektname \"Megaliner\") ist ein vierstrahliges Großraumflugzeug des europäischen Flugzeugherstellers Airbus S. A. S. mit zwei durchgängigen Passagierdecks. Der Tiefdecker ist das größte zivile Verkehrsflugzeug, das bisher in Serienfertigung produziert wurde. Während der Konzeptionsphase wurde das Flugzeug als \"Airbus A3XX\" bezeichnet. Die Endmontage des Flugzeugs findet in Toulouse und die Kabinenausrüstung in Hamburg-Finkenwerder statt. Der Erstflug dieses Langstreckenflugzeugs wurde am 27. April 2005 mit einer Maschine mit der Werksseriennummer MSN001 in der Version A380-841 absolviert. Bisher wurden 244 Flugzeuge dieses Typs bestellt. Die erste Maschine wurde am 15. Oktober 2007 in Toulouse an die Fluggesellschaft Singapore Airlines übergeben und hatte am 25. Oktober 2007 ihren ersten Passagierflug. Die Entwicklung des Airbus A380 geht bis in die 1980er-Jahre zurück, als erste Machbarkeitsstudien bezüglich eines Großflugzeuges sowohl für Passagiere als auch für den Frachtflugverkehr erstellt wurden. In der zweiten Hälfte der 1990er-Jahre ergab sich eine Marktsituation, die aus Sicht von Airbus eine Realisierung der Pläne gestattete. Diese Einschätzung resultierte einerseits aus der wachsenden Nachfrage nach Großraumflugzeugen, andererseits aus der Entscheidung des Airbus-Konkurrenten Boeing, keine Mittel für neue Versionen seiner Boeing 747 bereitzustellen. Nachdem im Jahre 2000 die ersten 50 Kaufabsichtserklärungen vorlagen, begann Airbus mit der Konstruktion. Beispiel der parallelen Abfertigung der beiden Decks. Hier der Airbus A380 am 22. März 2007 auf dem Frankfurter Flughafen nach seiner Rückkehr vom Testflug nach New York. Die erste Auslieferung der Passagierversion war ursprünglich für Juni 2006 an Singapore Airlines geplant. Aufgrund von Produktionsproblemen verzögerte sich der Zeitplan jedoch mehrfach, so dass die Erstauslieferung erst am 15. Oktober 2007 stattfinden konnte. Bei derartigen Verzögerungen haben die Fluggesellschaften vertraglich die Möglichkeit, Konventionalstrafen gegenüber Airbus einzufordern, was auch getan wurde. Dies geschah in dem Fall des Airbus A380 durch Schadensersatzzahlungen sowie verbilligte Verkäufe von anderen Flugzeugmodellen, insbesondere des Airbus A330, bzw. Nachbestellungen der A380. Der Airbus A380 startet auf der ILA 2006 zur Flugvorführung Ein Airbus A380-800 der Singapore Airlines bei der Landung in Zürich Der Listenpreis für einen Airbus A380-800 liegt im Mai 2008 zwischen 317,2 Millionen und 337,5 Millionen US-Dollar, der Durchschnittspreis bei 327,4 Millionen US-Dollar. Im Jahr 2010 stieg der Listenpreis auf bis zu 346,3 Millionen Dollar. Der Fonds \"Hansa Treuhand Sky Cloud Airbus A380\" gibt als Kaufpreis für einen Airbus A380 den Betrag von 149,2 Millionen Euro bzw. 210 Millionen US-Dollar an. Es handelt sich dabei um ein 2009 an Singapore Airlines ausgeliefertes Flugzeug. Die Leasinggesellschaft Hannover Leasing gibt als Kaufpreis für einen ebenfalls an Singapore Airlines ausgelieferten Airbus A380 den Betrag von 180 Millionen US-Dollar an. Der Kaufpreis liegt etwa 30 Mio. US-Dollar günstiger als für Mitbewerber, da Singapore Airlines den Innenausbau und Bestuhlung selbst vornimmt. Der Airbus A380 hat aufgrund seiner maximalen Passagieranzahl ein Alleinstellungsmerkmal, d. h. es existiert kein vergleichbares Flugzeug. Lediglich in den 1990er-Jahren verfolgten mehrere Hersteller bereits ähnliche Pläne: So plante etwa \"McDonnell Douglas\" mit der MD-12 in den frühen 1990ern ein Großraumflugzeug mit über 500 Sitzplätzen und zwei durchgehenden Passagierdecks. Boeing plante zuerst die 600- bis 800-sitzige Boeing NLA mit zwei durchgehenden Passagierdecks und danach verschiedene Weiterentwicklungen der Boeing 747 und stellte nach dem Scheitern derselben das Konzept des schnellen Sonic Cruisers vor, das jedoch mittlerweile ebenfalls abgebrochen wurde. Auch der russische Flugzeughersteller Iljuschin projektierte mit der Iljuschin Il-96-550 ein vergleichbares Modell, das jedoch aus einem Doppelrumpf bestanden hätte. Alle diese Projekte scheiterten. Zurzeit sorgen jedoch die relativ kleinen Langstreckenflugzeuge Boeing 787 sowie Airbus A350 für spürbare Konkurrenz. Diese Flugzeuge sind für den Direktflugverkehr anstatt des Drehkreuzkonzeptes optimiert und bieten trotzdem vergleichbar niedrige Betriebskosten. Weiterhin entwickelt Boeing mit der Boeing 747-8 einen leiseren, sparsameren und gering vergrößerten Jumbojet mit einer geplanten Erstauslieferung im Jahre 2011; dieser ist jedoch kleiner als der Airbus A380. Der Airbus A380 ist ein vierstrahliger Tiefdecker mit einem im Querschnitt ovalen Rumpf, an dem die nach hinten gepfeilten Tragflächen und ein Leitwerk in konventioneller Bauweise montiert sind. Wesentliches äußeres Unterscheidungsmerkmal gegenüber anderen Zivilflugzeugen sind die beiden übereinander angebrachten und über die gesamte Rumpflänge verlaufenden Fensterreihen. Das Basismodell der A380-Familie stellt hierbei die A380-800 dar, auf die sich die folgenden Abschnitte auch beziehen. Rumpfquerschnitt Airbus A380 in der Economy Class Der Airbus A380 besitzt zwei Leitwerke in konventioneller Bauweise, das Höhenleitwerk und das Seitenleitwerk. Das Seitenleitwerk besteht hierbei komplett aus kohlefaserverstärktem Kunststoff. Das Seitenruder ist zweiteilig ausgeführt. Die notwendige große Fläche des Seitenruders würde hohe Kräfte beim seitlichen Ausschlag verursachen und damit stärkere und schwerere Ruderbeschläge notwendig machen. Demnach wurde das Ruder gesplittet, um die Belastungen zu reduzieren. Die beiden Hälften werden jedoch simultan bewegt, sodass es die Wirkung wie ein einziges großes Ruder besitzt. Jede der beiden Steuerflächen wird von zwei Hydraulikaktoren angetrieben. Das Höhenleitwerk ist wie das Seitenleitwerk und die Hecksektion ebenfalls komplett aus kohlefaserverstärktem Kunststoff hergestellt. Es besitzt die Fläche einer gesamten Tragfläche des Airbus A320. Es hat insgesamt vier Höhenruder, die jeweils von zwei Hydraulikaktoren betätigt werden. Zudem besitzt das Höhenleitwerk auch einen Kraftstofftank, der zur Optimierung des Schwerpunktes individuell und automatisch am Boden betankt und im Flug geleert wird. Dieser Trimmtank kann mit einer Menge von 18,6 t Kerosin befüllt werden. Der Airbus A380 besitzt zwei Klimaanlagen (PACKs), die jeweils zwei sogenannte Air Generation Units (AGUs) beinhalten. Der Vorteil bei dem Design der \"AGUs\" besteht in einer sehr kompakten Bauweise. Ein Airbus A380-800 des Erstkunden Singapore Airlines Ein Airbus A380-800 des größten Kunden Emirates Emirates verkündete am 8. Juni 2010, weitere 32 Maschinen bestellt zu haben und erhöhte den bestehenden Auftrag somit auf insgesamt 90 Airbus A380-800. Am 17. Februar 2011 unterschrieb die japanische Fluggesellschaft Skymark einen Kaufvertrag über vier Airbus A380-800, über die Anfangs November 2010 bereits eine Absichtserklärung vereinbart worden war. Sie wird somit die erste japanische Fluggesellschaft, die die A380 in Dienst stellen wird. Qantas ist derzeit die einzige Fluggesellschaft, die den Airbus A380-842 mit den etwas stärkeren Rolls-Royce-Trent-972-Triebwerken einsetzt. Als Qantas bei einer sofort durchgeführten Kontrolle an drei weiteren Triebwerken ihrer A380-842 Öllecks fand, belegte sie all ihre sechs A380 mit einem Startverbot. Qantas hatte angekündigt, die Flugzeuge ab Ende November wieder fliegen zu lassen. Nach gut drei Wochen wurden zwei inzwischen wieder in Betrieb genommen.'),(18,'Airbus A330',' Der Airbus A330 ist ein zweistrahliges Großraumflugzeug des europäischen Flugzeugherstellers Airbus, das als Langstreckenflugzeug ausgelegt ist. Es besitzt zwei Turbofan-Triebwerke mit hohem Nebenstromverhältnis und wie alle modernen Verkehrsflugzeuge ein Zweimanncockpit. Der Erstflug fand am 2. November 1992 in der Version A330-300 statt. Die Endmontage des Airbus A330 findet in Toulouse statt. Vergleichbare Modelle zur A330 sind die Boeing-Modelle 767, 777 und die momentan in der Entwicklung befindliche 787 sowie die Iljuschin Il-96. Die A330 ist ein Schwestermodell der vierstrahligen A340 und soll mittelfristig durch die Baureihe Airbus A350 ersetzt werden. Auf der Luftfahrtmesse in Farnborough 2008 erreichte der Airbus A330 die Anzahl von 1000 Bestellungen. Bis Ende November 2010 wurden 744 von 1116 bestellten Flugzeugen dieses Typs ausgeliefert. Die erste Präsentation des Flugzeuges (Rollout oder Reveal genannt) fand am 14. Oktober 1992 statt. Einen Monat später, am 2. November 1992, hob der Airbus A330 in der 300er-Version erstmals ab. Der dritte Prototyp verfügte als erster über eine komplette Innenausstattung und wurde bereits in den Farben des Erstkunden Air Inter lackiert. Dieses Flugzeug wurde auch für die Zulassungsflüge verwendet, die neben Hochtests vom 29. März bis 8. April 1993 am Flughafen Khartum auch die ETOPS-Flüge beinhalteten. Die Testflüge wurden im Dezember 1994 nach dem Bestehen aller Tests abgeschlossen. In Europa wurde das Flugzeug am 21. Oktober 1993 zugelassen. Die ETOPS-Testflüge, welche bei zweistrahligen Flugzeugen regeln, wie viele Flugminuten der nächstgelegene Flughafen entfernt sein darf, wurden für den Airbus A330-300 vom 25. August bis zum 6. September 1993 durchgeführt. Bei diesen Tests flog die A330 sechs Stunden mit nur einem Triebwerk über dem Nordatlantik. Die A330 bekam damit die Zulassung für den 90-Minuten-ETOPS. Ab 1998 wurden alle neuen Airbus A330 für den 180-Minuten-Flug mit nur einem Triebwerk zugelassen. Im November 2009 hat die europäische Luftaufsichtsbehörde EASA allen Typen des Airbus A330 die 240 Minuten ETOPS Zulassung genehmigt. Die EASA begründete diese Zulassung mit der hohen Zuverlässigkeit dieses Typs. Kunden können diese Erweiterung als Option für neue A330 bestellen. Durch die steigenden Kerosinpreise konnte die A330 mit der Zeit immer mehr ihren im Vergleich zur A340 geringeren Kerosinverbrauch als Vorteil ausspielen. Deshalb verkaufte sich der Airbus A330 weiterhin sehr gut. Somit bestätigte sich Hartmut Mehdorns Voraussage, dass sich der für Charterfluggesellschaften konzipierte Airbus A330 langfristig dreimal so gut verkaufen werde wie die A340. Experten hätten dies nicht erwartet. Ein weiterer Aufschwung der Bestellungen zeigte sich bei Airbus durch die Verschiebung des Erstfluges und der Auslieferung der Boeing 787. Viele Fluggesellschaften leasen oder kaufen Airbus A330 als Ersatz für die geplanten 787. Aus diesem Grund verschob Airbus den Erstflug und die Auslieferung des Airbus A330-200F, da die Fertigungslinie für A330 in Toulouse ausgelastet ist. In vielen Bereichen der A330 findet man die Anwendung der sogenannten Kommunalität wieder. Das bedeutet, dass Systeme verschiedener Flugzeugtypen identisch sind, um damit Kosten einzusparen. So ist der Airbus A330 praktisch eine A340-300 mit nur zwei Triebwerken. Die A330 hat im Gegensatz zur vierstrahligen A340 keine Verstärkung im Bereich der Tragflächen, wo sich bei der A340 die äußeren Triebwerke befinden. Weiterhin ist die Avionik im Wesentlichen die gleiche wie bei der A340 und der A320-Familie, ebenso die Pilotenkanzel. Die Cockpits der A380 und der A350 orientieren sich wiederum hieran, wodurch eine Reduzierung der Ausbildungskosten der Flugzeugführer erreicht wird. Bei der Lagerung und Anschaffung von Ersatzteilen können diese Synergieeffekte genutzt werden. Im Airbus A330 finden sich viele technische Neuerungen. Dazu gehört etwa ein digitales Fly-by-wire-Flugkontrollsystem, das erstmals bei einem Großraumflugzeug angewandt wurde, ebenso wie ein Sidestick an Stelle eines Steuerhorns. Die A330 wurde mit einem sogenannten Glas-Cockpit mit CRT- beziehungsweise später LCD-Bildschirmen ausgeliefert unter gleichzeitiger Reduzierung der Anzahl analoger Instrumente. In späteren Tranchen wurden auch die analogen „Back-up“-Instrumente durch ein zentrales Kombiinstrument ersetzt. Erste Sektoren des Rumpfes werden teilweise aus Verbundwerkstoffen gefertigt. Der Airbus A330 besitzt ein sogenanntes FADEC-System, bei dem die Triebwerkskontrolle und -überwachung von einem Computer übernommen werden. Bauweise und Durchmesser des Rumpfes wurde aus dem A300/A310-Programm übernommen und je nach Version entsprechend verlängert und durch die Lage der Türen modifiziert. Der Rumpf ist in Aluminium-Halbschalenbauweise konstruiert und in Sektionen unterteilt, um den Transport zu vereinfachen. Er ist komplett druckbelüftet, außer im Bereich des Fahrwerkes und des Hecks. Der Airbus A330 besitzt insgesamt 8 Türen, die zum Teil als Notausgänge konzipiert sind. Im unteren Rumpfbereich befindet sich vor und hinter dem Hauptfahrwerk je ein Frachtraum, der durch jeweils eine große Frachttür von der rechten Seite aus zu beladen ist. Die Frachträume sind komplett mit einem Rollenbahnsystem ausgestattet, welches die Beladung mit Standardcontainern ermöglicht. Die A330 verfügt über einen außergewöhnlich großen Frachtladeraum, dessen Frachtvolumen dem der größeren Boeing 747 entspricht. Der Airbus A330 ist als Tiefdecker ausgelegt. Die Tragflächen sind eine Neuentwicklung, in die aber die Erfahrungen aus dem Airbus A310 eingeflossen sind. Die Tragflächen wurden speziell für die Langstrecke entwickelt, woraus sich eine relativ hohe Spannweite ergab, auch um den erforderlichen Kraftstoff unterzubringen. Das Profil ist eine Weiterentwicklung des superkritischen Profils der A310. Die Tragflächen unterscheiden sich nur geringfügig von denen der A340, lediglich die Leitungen zu den Triebwerken (von denen die A340 vier besitzt) und deren Aufhängungen sind unterschiedlich. Die Flügel bestehen aus drei Kastenholmen und sind aus Aluminium gefertigt. Die Pfeilung beträgt 30°. Sie sind fest mit der im Rumpf integrierten Flügelbox verbunden. In jedem Flügel befinden sich zwei Kraftstofftanks. Der Airbus A330 hat dazu noch einen Centertank im Rumpf, und somit eine Kapazität von 135.000 Litern Kraftstoff. Verkleidungen, die äußeren Landeklappen, die Spoiler und Querruder sind aus Verbundfaserkunststoff gefertigt. Als Auftriebshilfen hat die A330 an der Vorderkante Slats, welche an den Triebwerksaufhängungen unterbrochen sind. Sie können durch heiße Triebwerkszapfluft enteist werden. An der Hinterkante befinden sich die Flaps. Diese sind als einfaches Fowlersystem ausgelegt und verlaufen durchgehend vom Rumpf bis zu dem Punkt, wo sich beim Airbus A340 die äußeren Triebwerke befinden. Hier schließen sich zwei unabhängige Querruder an, die von jeweils zwei Hydrauliksystemen angesteuert werden. Die Querruder werden durch auf der Tragflächenoberseite angebrachte Spoiler unterstützt, diese dienen auch als Luftbremsen. An der Tragflächenspitze sind Winglets angebracht, die sowohl den Widerstand verringern, als auch selbst Auftrieb erzeugen. Das Fahrwerk des Airbus A330 besteht aus einem einachsigen Bugfahrwerk mit zwei Reifen und zwei Hauptfahrwerken, die zweiachsig mit jeweils vier Reifen ausgestattet sind. Es ist als konventionelles Einziehfahrwerk ausgeführt und wird hydraulisch betätigt. Die Bugradlenkung sowie die Carbonbremsen, mit welchen die acht Hauptfahrwerksreifen ausgestattet sind, werden ebenfalls hydraulisch betätigt. Das Bugfahrwerk ist bei der A330 ungebremst. Am Airbus A330 werden insgesamt drei verschiedene Triebwerke eingesetzt: das General Electric CF6-80E, das PW4000-100 von Pratt & Whitney und das Rolls-Royce Trent 700. Die letzten zwei wurden speziell für die A330 entwickelt. Das Trent 700 besitzt beim Airbus A330 einen Marktanteil von ungefähr 53 %, Abnehmer sind zum Beispiel EgyptAir, Lufthansa, Gulf Air und Etihad Airways. Die restlichen 47 % Marktanteil teilen sich das PW4000 und das CF6. Beispiele für Nutzer sind hier für das CF6 Air France und Qantas und für das PW4000 China Southern und Korean Air. Dass Rolls-Royce mit seinem Triebwerk Marktführer beim A330 ist, liegt daran, dass das Trent 700 das kleinste und leichteste aber gleichzeitig das stärkste angebotene Triebwerk ist. So entsteht weniger Luftwiderstand und die Flugzeuge brauchen weniger Kerosin. Das CF6 hingegen kostet zwar nur die Hälfte, gleichzeitig ist es aber größer und verursacht daher einen größeren Luftwiderstand. Das PW4000 liegt überall in der Mitte, ist aber das Schwerste der drei und verkleinert mit seinem Gewicht die Reichweite. Beispiel: Ein Airbus A330-323X ist ein Airbus A330-300 mit PW 4168 Triebwerken und einem erhöhten maximalen Abfluggewicht Der Airbus A330-200 Prestige ist eine VIP-Variante der A330-200 zur Nutzung als Langstrecken-Geschäftsflugzeug. Die Leistungsdaten werden von Airbus nicht genau genannt. Bisher wurden zwei Exemplare der A330-200 Prestige bestellt. MRTT steht für \"Multi Role Transport T\'\"anker\" (dt. \"Mehrzweck-Transport-Tanker\") und bezeichnet das für Luftbetankung und Transporte ausgerüstete militärische Modell A330 MRTT. Der MRTT basiert auf dem zivilen Airbus A330-200 und kann ohne weitere Zusatztanks 111 Tonnen Treibstoff mitführen. Als Mehrzweckflugzeug kann er gleichzeitig als Tankflugzeug genutzt werden und 300 Soldaten oder 380 Passagiere befördern oder stattdessen eine Nutzlast von bis zu 45 Tonnen tragen. Neben der A330MRTT kann auch weiterhin die A310 MRTT bestellt werden; diese Version entsteht aus umgerüsteten Passagiermaschinen des kleineren Typs A310. Da der Airbus A330 die gleichen Tragflächen wie die vierstrahlige A340 besitzt, ist es relativ einfach möglich, dieses Modell für die Luftbetankung umzubauen. Statt der zusätzlichen äußeren Triebwerke werden \"Cobham 905E\"-Schlauchbehältersysteme angebaut. Diese Art des Nachtankens während des Fluges erlaubt die gleichzeitige Abgabe von Treibstoff an zwei Empfänger-Flugzeuge. So kann über die an einem 27,5 m langen Schlauch hängenden Fangtrichter bis zu 1590 l Flugbenzin pro Minute abgegeben werden. Speziell für die A330MRTT hat Airbus Military das Tankausleger-System \' (ARBS) neu entwickelt. Es kann auf bis zu 17 m ausgefahren werden und hat eine Abgabemenge von 4540 l/min. Gesteuert werden die Betankungen über einen Arbeitsplatz an der im Heck befindlichen Betankungskonsole. Sie verfügt über die Bedien- u. Kontrollsysteme sowie Sichtkontakt zu den aufzutankenden Luftfahrzeugen mittels eines 2D/3D-Kamerasystems (tag-/nachtfähig). Anstelle des ARBS kann unter dem Heck des Flugzeugrumpfes ein weiteres, abnehmbares Schlauchsystem (Cobham 805E) mit einer Abgabemenge von 2300 l/min angebracht werden. So kann, bei einer Geschwindigkeit von 330–600 km/h, auch mit unterschiedlichen Flugzeugtreibstoffarten befüllt werden. Airbus plant bereits seit längerer Zeit, die A330-200 auch als kommerziellen Frachter anzubieten. Nach den Ereignissen des 11. September 2001 wurden diese Pläne zunächst nicht ausgearbeitet. Als Anfang 2006 das bevorstehende Produktionsende der A300 einschließlich ihrer Frachtvariante bekanntgegeben wurde, verdichteten sich die Gerüchte, dass diese Pläne wieder aufgenommen werden sollen. Ursprünglich hatte Airbus vor, die A330-200F im Rahmen der Luftfahrtmesse Farnborough International Airshow offiziell der Öffentlichkeit vorzustellen. Eine entsprechende Presseerklärung inklusive der Bekanntgabe einer Bestellung über 30 Exemplare des Typs fand sich auch für kurze Zeit auf der Airbus-Website. Allerdings wurde diese Erklärung wenig später wieder entfernt, gerüchteweise wegen kurzfristiger Probleme beim Vertragsabschluss mit dem Erstkunden. Die erste feste Absichtserklärung über 20 A330-Frachter für die US-Leasinggesellschaft Intrepid Aviation wurde schließlich am 15. Januar 2007 bekannt gegeben, gefolgt von der ersten Festbestellung einen Tag später. Erstkunde ist die indische Frachtfluggesellschaft Flyington Freighters, die sechs Exemplare des Airbus A330-200F zur Auslieferung ab Ende 2009 bestellt hat. Dieser Termin wurde aber verschoben, da die A330/A340-Fertigungslinie durch die aktuell hohe Nachfrage an sparsamen Jets ausgelastet ist. Am 5. November 2009 erfolgte der Erstflug vom Flughafen Toulouse-Blagnac aus. Am Tag des Erstfluges wurde bekannt gegeben, dass Etihad Crystal Cargo den ersten Airbus A330-200F im Sommer 2010 übernehmen wird. Im Juli 2010 wurde der erste Airbus A330-200F im Rahmen der \"Farnborough International Airshow\" an Etihad Crystal Cargo ausgeliefert. Nachdem sich die A330-300 als erstes Modell der A330-Reihe zunächst besser verkaufte als das kleinere Schwestermodell A330-200, ist dieses inzwischen populärer. Trotzdem verzeichnet der Airbus A330-300 weiterhin gute Verkaufszahlen. Bis Juli 2010 hat Airbus Aufträge für 448 Maschinen erhalten, von denen 318 bereits ausgeliefert wurden. Eine Maschine ging bei einem Absturz verloren (Siehe Text). Die Bezeichnung -300X bezieht sich also nicht auf die Cockpitinstrumentierung, sondern ausschließlich auf das erhöhte Startgewicht und die vergrößerte Reichweite. Die Mehrheit der seit Juli 1999 ausgelieferten A330-300 sind -300X, verfügen also über den zusätzlichen Treibstofftank. Die einzigen Ausnahmen sind nach aktuellem Stand sämtliche Airbus A330-300 von Qantas, Qatar Airways und China Airlines, die daher nicht das zusätzliche \"X\" in der Typbezeichnung führen. Im Rahmen der Pariser Luftfahrtschau 2007 in Le Bourget gab Airbus bekannt, dass man von Intrepid Aviation, einem Käufer der A330-200F, auf die Möglichkeit einer Frachtversion des Airbus A330-300 angesprochen wurde. Laut eigenen Angaben wird diese Möglichkeit bereits mit Frachtfluggesellschaften wie FedEx, DHL und UPS Airlines untersucht. Ein Zeitplan wurde bisher noch nicht bekanntgegeben.'),(21,'Boeing 747',' Die Boeing 747 (umgangssprachlich auch \"Jumbo-Jet\" in Anlehnung an den legendären Elefanten „Jumbo“) ist ein vierstrahliges Großraumflugzeug des US-amerikanischen Flugzeugherstellers Boeing, das zur Zeit seiner Entwicklung in den 1960er Jahren das mit Abstand größte Passagierflugzeug der Welt war. Es startete am 9. Februar 1969 zu seinem Erstflug und gehört seitdem zu den bekanntesten und meistgenutzten Flugzeugen überhaupt. Die Maschinen werden hauptsächlich für zivile Zwecke eingesetzt und mehrheitlich von europäischen und asiatischen Fluggesellschaften betrieben. Die 747 fliegt mit hoher Unterschallgeschwindigkeit; die meisten Versionen sind als Langstreckenflugzeuge ausgeführt. Charakteristisch für die Silhouette der Boeing 747 ist ihr „Buckel“, in dem sich über dem Hauptfluggastdeck unter anderem die Pilotenkanzel befindet. Der „Buckel“ wurde im Laufe der Entwicklung zu einem immer größer werdenden zweiten Fluggastdeck erweitert, das sich in neueren Varianten über das vordere Drittel der Flugzeugkabine erstreckt und in dem sich in der Regel die Sitzplätze der First oder Business Class befinden. Bei den Frachtversionen ist der „Buckel“ nicht so lang wie bei Passagierversionen, da die Höhe des Frachtraums unter ihm eingeschränkt ist. Video einer Boeing 747 der Lufthansa nach der Ankunft Verbürgt ist der Dialog zwischen dem Pan-Am-Chef Juan Trippe und dem Boeing-Chef William Allen, bei dem Trippe sagte: \"If you build it, I buy it.\" (Wenn Du es baust, dann kaufe ich es.) und Allen antwortete: \"If you buy it, I build it.\" (Wenn Du es kaufst, dann baue ich es.) Nach Bestellung von 25 Flugzeugen durch Pan Am am 13. April 1966 wurde daraufhin mit der Entwicklung begonnen. Leitender Ingenieur und (zusammen mit Juan Trippe und William Allen) der „Vater“ der Boeing 747 war Joe Sutter. Die Montage des ersten Prototyps begann im Januar 1967, die Roll-Out-Zeremonie fand am 30. September 1968 statt. Zum Zeitpunkt des Jungfernflugs am 9. Februar 1969 war die 747 das größte Passagierflugzeug der Welt und blieb es bis zum Erstflug des Airbus A380 am 27. April 2005. Zuerst wurde die 747 als ein doppelstöckiges (in etwa zwei 707-Rümpfe übereinander) Flugzeug geplant. Die 747 sollte auch leicht in einen Frachter umzurüsten sein, da bereits (nach damaligen Planungen) Mitte der 1970er Jahre das amerikanische Überschallflugzeug Boeing 2707 nahezu alle interkontinentalen Passagierflüge übernehmen sollte. Der Umbau war jedoch wegen der schwierigen Beladbarkeit des Oberdecks mit Fracht nicht gut möglich; außerdem befürchtete man, dass Passagiere schlecht aus ihm evakuiert werden könnten. Schließlich wurde ein kreisrunder Rumpf mit großem Durchmesser gewählt, der eine zuvor nicht dagewesene Großraumpassagierkabine und als Frachter die Beladung mit zwei Reihen 8 Fuß (ca. 2,44 m) breiter Luftfrachtcontainer/Paletten unterschiedlicher Länge nebeneinander auf der ganzen Kabinenlänge ermöglichte. Durch das Bugtor in der Flugzeugnase der als Frachter gebauten Maschinen können z. B. bis zu 40 Fuß lange Luftfrachtcontainer oder andere, noch längere, Fracht geladen werden, deren Länge und Breite nur durch die Kabinenmaße der B 747 Grenzen gesetzt sind. Wegen der relativ spitzen Nase der Boeing 747 ist jedoch das nach oben aufklappbare Bugtor (anders als bei Frachtflugzeugen z. B. Lockheed C-5, Antonov An-124) nicht so breit wie der volle Rumpfdurchmesser sondern nur 3,45 m x 2,49 m Groß, sodass die Container nacheinander geladen werden müssen. Das Bugtor ist auch der Grund dafür, dass das Cockpit ins Oberdeck wanderte. Hinter diesem entstand auch noch im aerodynamischen auslaufenden Oberdeck eine kleine zusätzliche Passagierkabine. Durch den Fußboden des Oberdecks ist die Ladehöhe durch das Bugtor auf etwa 8 Fuß beschränkt. Um die volle Rumpfhöhe zum Laden von 10 Fuß (3,05 m) hohen maximal ca. 20 Fuß langen Paletten nutzen zu können, muss deshalb das Rumpftor auf der hinteren linken Seite benutzt werden. (Um möglichst viele dieser Paletten laden zu können, besitzen auch die Frachtversionen der 747-400 und 747-8 das kurze, ursprüngliche Oberdeck. Dieses ist außerdem leichter, so dass die Nutzlast steigt.) Die Boeing 747 selbst stammt damit nicht von Boeings gescheiterten CX-HLS Plänen ab, jedoch wurde ihr erster Triebwerkstyp aus P&Ws unterlegenem Entwurf für den \"CX-HLS \"-Wettbewerb entwickelt. Boeing erwog Mitte der 1990er Jahre verschiedene Weiterentwicklungen der 747-400, um der sich abzeichnenden geänderten Wettbewerbssituation durch Entwicklung der heutigen A380 zu begegnen. Nachdem sich jedoch im Gegensatz zum Airbus-Projekt keine Kunden für diese neuen Varianten der 747 fanden, beendete Boeing seine \"747X\"- bzw. \"747X-Stretch\"-Pläne und präsentierte stattdessen den Sonic Cruiser. Die Krise der Zivilluftfahrt kurz nach der Jahrtausendwende, verstärkt durch die Terroranschläge am 11. September 2001, ließ auch dieses Projekt scheitern. Nachdem sich die Zivilluftfahrt 2004 wieder erholt hatte und neue, sparsamere Triebwerke in der Entwicklung waren, stellte Boeing unter dem Namen \"Boeing 747 Advanced\" einen Plan für eine wirtschaftlichere und leisere Boeing-747-Variante vor. Diese war jedoch deutlich kleiner als die A380 und sollte die Marktlücke zwischen den Flugzeugen Airbus A340-600 und Boeing 777-300 sowie der A380 erschließen. Am 15. November 2005 wurde diese Variante unter dem offiziellen Namen Boeing 747-8 der Öffentlichkeit präsentiert. Während sich die Frachtversion 747-8F sofort verkaufte, erhielt Boeing erst nach einer weiteren Rumpfverlängerung und somit Kapazitätssteigerung am 6. Dezember 2006 den ersten Auftrag von der Lufthansa für 20 Exemplare der Passagierversion 747-8I. Am 16. März 2007 gab Boeing bekannt, die Produktion der 747-400 in der Passagierversion einzustellen. Aus diesem Grund wurden drei Bestellungen von Boeing gekündigt. Die letzte Passagiermaschine des Typs Boeing 747-400 wurde im April 2005 an Air China ausgeliefert. Am 14. Januar 2008 verkündete der britische Milliardär Sir Richard Branson, Inhaber der Fluggesellschaft Virgin Atlantic Airways, dass der erste reguläre Linienflug einer Boeing 747-400 mit Biokraftstoff anstelle von Kerosin bevorstehe. Der Flug solle vom Londoner Flughafen Heathrow nach Amsterdam erfolgen und den Ingenieuren wichtige Erkenntnisse über die Nutzung von Biokraftstoff liefern. Der Einsatz von Biokraftstoff in der Luftfahrt stellt eine besondere Herausforderung dar, da gewährleistet sein muss, dass der Treibstoff auch in einer Flughöhe von über 10.000 m und Temperaturen von unter ?60 °C flüssig bleibt und eine konstante Verbrennungsleistung bietet. Der Flug wurde am 24. Februar 2008 durchgeführt. Diese Angaben beziehen sich, wenn nicht anders angegeben, auf die Version Boeing 747-400. Blick auf die Pilotenkanzel einer Lufthansa Boeing 747-400. First Class im Bugbereich einer Boeing 747-400 der Cathay Pacific Es gibt noch andere Flugzeuge mit einem „Buckel“ über dem Rumpf wie die Aviation Traders ATL-98 Carvair, die auf Basis der Douglas DC-4 von 1961 bis 1969 gebaut wurde und als ideeller Vorläufer der Boeing 747 gilt. Weiterhin verfügen die Frachtflugzeuge Lockheed C-5, Antonow An-124 und An-225 über ein Cockpit im Oberdeck des Rumpfes sowie über ein Bugladetor, das sich prinzipiell mit dem der Frachtversionen der 747 vergleichen lässt. Jedoch haben diese keinen Buckel, sondern das Oberdeck liegt vor dem Flügel der als Schulterdecker angelegten Flugzeuge. Die Listenpreise der unterschiedlichen Boeing 747-Versionen lagen 2008 zwischen 234 (747-400) und 308 (747-8) Millionen US-Dollar. Damit liegt der Listenpreis einer Boeing 747-400 unter dem der kleineren, jedoch jüngeren Boeing 777-300ER mit 257 bis 286,5 Millionen US-Dollar. Insbesondere zu Beginn der Markteinführung des Typs (Ende der 1960er, Anfang der 1970er) war die Boeing 747 auch ein Prestigeobjekt. Die 747 in der Flotte zu haben war für renommierte Fluggesellschaften sozusagen ein Muss. Die Boeing 747 lässt sich in das Marktsegment zwischen den größten Großraumflugzeugen mit nur einem Passagierdeck, dem Airbus A340-600HGW sowie der Boeing 777-300ER, und dem Airbus A380 einordnen. Sie hat beim neuesten Modell 747-8 eine Kapazität von rund 470 Sitzplätzen (in typischer 3-Klassen-Konfiguration); in dieser Größenordnung hat sie eine Monopolstellung inne. Schon bei der Entwicklung der Boeing 747-400 wurde ein besonderes Augenmerk auf die Wirtschaftlichkeit gelegt, die sich im Vergleich auch heute noch auf hohem Niveau befindet. Das neue Modell Boeing 747-8 übernimmt einige konstruktive Merkmale der Boeing 787. Dies führt zu einer weiteren, erheblichen Steigerung der Wirtschaftlichkeit und Umweltverträglichkeit. Eine Boeing 747-100 der United Airlines Eine Boeing 747-100 der JAL in der Variante \"SUD\" mit verlängertem Oberdeck Die Boeing 747-100 war das erste Modell der erfolgreichen 747-Familie und bekam schon bald nach ihrem Erscheinen den Spitznamen \"Jumbo\". Von der 747-100 wurden in allen Untervarianten insgesamt 205 Maschinen gebaut. Die letzte gebaute 747-100 war eine -100SR für Japan Airlines, die im September 1986 ausgeliefert wurde. Eine Boeing 747-200 der Air Pullmantur Diese Version der 747-200 ist wahlweise als reine Passagier- oder Frachtmaschine umrüstbar. Dazwischen kann der Betreiber außerdem zwischen insgesamt fünf verschiedenen Passagier/Fracht-Konfigurationen wählen. Air Canada übernahm am 7. März 1975 die erste 747-200M. Bis zur letzten Auslieferung an Iberia am 5. April 1988 waren 78 Boeing 747-200M gebaut worden. Sie besitzt eine linke Ladetür (Side Cargo Door) im Hinterrumpf. Einige 747-200 (wie auch einige 747-100SR für Japan Airlines) wurden mit einem um circa 7 m verlängerten Oberdeck ausgestattet, so dass dort nun bis zu 69 Sitze untergebracht werden können; diese Version heißt 747-200SUD (\"S\"tretched \"U\"pper \"D\"eck, deutsch: gestrecktes Oberdeck). Außerdem wurde die Treppenverbindung geändert und die Notausgänge wurden vergrößert. Das Gesamtgewicht erhöht sich hierdurch um 2 %. \"SUD\" ist keine offizielle Typbezeichnung, das heißt eine Boeing 747-200B mit verlängertem Oberdeck ist offiziell nach wie vor eine 747-200B, keine 747-200SUD. 747-200 mit der SUD-Modifikation wurden noch bis zum ersten Quartal 2004 vor allem von KLM Royal Dutch Airlines genutzt. Einige Exemplare wurden nachträglich mit dem verlängerten Oberdeck ausgerüstet. Das verlängerte Oberdeck der SUD wurde später bei der 747-300 in die Serie übernommen. Im Zuge der Entwicklung der 747SP wurde von Boeing auch eine dreistrahlige Auslegung der verkürzten 747 in Erwägung gezogen. Dabei sollten zwei Triebwerke unter den Tragflächen und das dritte Triebwerk ähnlich der Lockheed L-1011 im Flugzeugheck untergebracht werden. Von der dreistrahligen Konstruktion versprach man sich Gewichts- und Verbrauchseinsparungen. Letztlich wurde dieser Ansatz jedoch wegen der aufwändigen Umkonstruktion nie realisiert. Zwischenzeitlich wurde diese Planung als \"Boeing 747-300\" bezeichnet. Eine Boeing 747 SP der Syrian Arab Airlines Eine Boeing 747 SP der Bahrain Royal Flight; gut sichtbar sind die einfach ausgeführten Klappen Eine Boeing 747-400 der Virgin Atlantic Die 747-400-Serie erreichte mit ihren verschiedenen Untervarianten eine Zahl von insgesamt ca. 700 Bestellungen (Stand November 2006). Sie ist damit die meistgebaute Variante der Boeing 747. Bis zur Aufnahme des regulären Betriebs des Airbus A380 war die 747-400 das größte Passagierflugzeug der Welt. Sie soll in Zukunft von der \"747-8\" ersetzt werden, deren Erstflug 2010 stattfand. In einigen Konfigurationen genügt die Reichweite der 747-400, um nonstop von New York nach Hongkong zu fliegen, was einem Drittel der Strecke um die Erde entspricht. Im Jahr 1989 flog eine Boeing 747-400 der Qantas nonstop von London nach Sydney – dies sind etwa 18.000 Kilometer. Allerdings war die Maschine nicht beladen und flog nicht auf einem Linien- sondern einem Testflug. Eine 747-400 besteht aus sechs Millionen Einzelteilen, davon sind allein die Hälfte Befestigungselemente, die in 33 verschiedenen Ländern hergestellt werden. Tragfläche einer Boeing 747-400 mit Winglet Bild der Boeing 747LCF mit aufgeschwenktem Heck Die \"Boeing 747LCF\" (\"L\"arge \"C\"argo \"F\"reighter) – zumeist „Dreamlifter“ in Anlehnung an die Boeing 787 „Dreamliner“ genannt– ist ein Frachtflugzeug auf Basis der Boeing 747-400. Das Seitenleitwerk wurde jedoch aufgrund des höheren Aufbaus zur besseren Umströmung durch das deutlich höhere Leitwerk der Boeing 747 SP ersetzt. Die bei der ursprünglichen 747-400 vorhandenen Winglets wurden nach ersten Testflügen entfernt, da diese in Kombination mit dem modifizierten Rumpf zu starken Vibrationen führten. Die Boeing 747LCF wurde am 13. Oktober 2003 angekündigt; mit ihrer Hilfe sollen die Bauteile der Boeing 787 schneller als mit dem Schiff von den einzelnen Werken, die sich unter anderem in Japan und Italien befinden, zur Endmontage in Everett gelangen. An der Entwicklung waren Boeings Entwicklungsstudio in Russland, Rocketdyne und Gamesa Aeronautica aus Spanien beteiligt. Der Umbau der ehemals als Passagierflugzeuge genutzten Boeing 747-400 wurde von der taiwanischen Firma \"Evergreen Aviation Technologies\" (EGAT) durchgeführt. Der Erstflug eines Dreamlifter erfolgte am 9. September 2006, die Zulassung durch die FAA am 5. Juni 2007. Aktuell (Stand März 2011) sind vier Flugzeuge im Einsatz. Die 747-8 ist gegenüber der 747-400 weiter vergrößert und soll die Kapazitätslücke zwischen Boeing 777-300 bzw. Airbus A340-600 und Airbus A380 schließen. Die Kapazitätsteigerung geschieht durch die Streckung des Rumpfes, die die Boeing 747-8 mit 76,30 Meter zum längsten Passagierflugzeug der Welt macht und somit die Airbus A340-600 (75,36 Meter) ablöst. Sowohl eine Frachter-Variante unter der Bezeichnung \"747-8 Freighter\" (kurz: \"747-8F\") wie auch eine Passagiervariante mit dem Namen \"747-8 Intercontinental\" (kurz: \"747-8I\") werden gebaut. Beide Varianten bekommen aerodynamisch überarbeitete Flügel mit neuen Flügelenden (Raked Wingtips), verbesserten Landeklappen und spaltlosen Krügerklappen. Im Rumpf und in den Flügeln kommen neue leichtere und korrosionsbeständigere Aluminiumlegierungen zum Einsatz. Zusätzlich wurde ein Cockpit entwickelt, dessen Auslegung sich an den Pilotenkanzeln der 747-400 orientiert, um die Piloten dieses Typs in nur zwei Tagen auf die neue Version umschulen zu können. Das Cockpit der 747-8 wird lediglich ein neues Flight Management System der Boeing 777 sowie neue LCD-Bildschirme und ein ISFD wie bei späten Versionen der 747-400, aber beispielsweise keine Head-Up-Displays wie bei der 787 erhalten, um zusätzlichen Schulungsaufwand zu vermeiden. Die wichtigste technologische Neuerung stellen jedoch die von der 787 übernommenen Triebwerke vom Typ General Electric GEnx dar. Da Boeing einen Exklusivvertrag mit General Electric abgeschlossen hat, wird die 747-8 nicht mit Triebwerken anderer Hersteller erhältlich sein. Boeing geht von einem Bedarf von 960 Maschinen im Segment über 400 Sitzplätze bis 2025 aus. Die Boeing 747-8F während ihres Erstflugs Die ersten Aufträge für die \"747-8I\" umfassten ausschließlich einzelne Flugzeuge, die an private Käufer als VIP-Maschinen gehen werden. Erst am 6. Dezember 2006 (nachdem sich Boeing zur erweiterten Rumpfstreckung entschlossen hatte) gab die Lufthansa bekannt, dass man einen Kaufvertrag über 20 Boeing 747-8I plus 20 Optionen geschlossen habe. In der Lufthansa-Konfiguration soll die 747-8I 386 Passagieren Platz bieten. Die Auslieferungen sollen nach Verzögerungen ab 2011, statt wie ursprünglich geplant ab 2010, erfolgen, die Flugzeuge ab 2012 im Liniendienst stehen. Eine zweite Festbestellung der Passagiervariante durch eine Fluggesellschaft wurde am 4. Dezember 2009 bekanntgegeben, als Korean Air Lines erklärte, dass man fünf 747-8I zur Auslieferung zwischen 2013 und 2015 bestellt habe. Der Listenpreis der 5 Maschinen liegt nach Angabe von Boeing bei 1,5 Milliarden US-Dollar.. Air China hat am 7. März 2011 eine Vereinbarung über den Kauf von fünf 747-8I mit Boeing geschlossen. Diese wird als Kauf gültig, sobald die Regierung zugestimmt hat. Mit den 20 bestellten Maschinen der Lufthansa, den 5 von Korean Air Lines sowie den gegenwärtig (Januar 2011) 8 über \"Boeing Business Jet\" georderten VIP-Exemplaren liegen für die \"747-8I\" insgesamt 33 feste Bestellungen vor. Eine umgerüstete Boeing 747-200SF der Malaysia Airlines Cargo Viele alte Passagier-Boeing 747 der Varianten 100, -200, -300 und -400 wurden bislang am Ende ihres Passagierflugzeuglebens in Frachtflugzeuge umgebaut. Nachträglich in Frachtflugzeuge umgebaute Passagiermaschinen werden im Allgemeinen als \"Special Freighter\" (SF) bezeichnet (siehe: Boeing 757-200SF). Dazu werden die Passagiersitze entfernt, der Fußboden wird verstärkt und die Maschinen erhalten hinten links im Rumpf eine große Frachttür, haben also im Gegensatz zu bereits als Frachter ausgelieferten 747-x00F kein Bugtor. Im Frachtraum wird ein automatisches Ladesystem für Container und Paletten installiert. Die SF-Maschinen lassen sich von den 747-x00F an den vorhandenen (jedoch mit Blenden versehenen) Fenstern unterscheiden, über welche die -x00F nicht verfügen. Die auf der Boeing 747-200B basierende Boeing E-4 der USAF, benutzt als fliegende Kommandozentrale Viele der großen Linienfluggesellschaften der Welt verfügen über die Boeing 747. Die größten Flotten werden aktuell (Stand September 2007) von British Airways und Japan Airlines betrieben. In Deutschland besitzt die Lufthansa 30 Exemplare der 747-400; darüber hinaus ist sie Erstkunde für die 747-200F und die 747-8I; auch die 747-100 und 747-200 gehörten zur Flotte. Mit der Liberalisierung des US-Luftverkehrsmarktes sank in den USA die Nutzung des „Jumbo“. Dies liegt einerseits an der schwierigen finanziellen Situation vieler Gesellschaften, die zum Untergang vieler ehemals großer 747-Betreiber (u. a. Pan Am und TWA) führte. Die Liberalisierung des US-Luftverkehrsmarktes führte außerdem dazu, dass viele US-Gesellschaften (unter anderem American Airlines und Continental Airlines) die 747 wieder aus ihren Flotten nahmen und durch kleinere Typen ersetzten, um häufigere Inlandsverbindungen anbieten zu können. Derzeit betreiben in Nordamerika nur Delta Air Lines, nach der Übernahme der Northwest Airlines, und United Airlines Exemplare der Passagier-747; jedoch betreibt UPS Airlines eine größere 747-Frachter-Flotte. Die aufstrebenden Airlines des Nahen Ostens wie Etihad Airways und Emirates setzen ebenfalls keine 747 im Passagierdienst ein, sind jedoch Kunden der neu entwickelten A380 (Emirates ist mit 90 [Stand 8. Juni 2010] bestellten Exemplaren Hauptkunde für diesen Typ). Neben den USA mit ihrer \"VC-25A\" (Air Force One) setzen auch einige weitere Staaten die Boeing 747 als Regierungsflugzeug ein. So verfügt etwa die Regierung von Japan über zwei 747-400 zur Beförderung des Premierministers, des Kaisers (Tenn?) mit der Kaiserin sowie weiteren ranghohen Offiziellen des Landes. Die Maschinen besitzen ein ähnliches Markierungsschema wie die US-amerikanische Air Force One, das Wort \"Japan\" in Kanji und englisch auf dem Rumpf ausgeschrieben, einen roten Streifen von vorne bis hinten entlang der Fenster und der Hinomaru als Hoheitszeichen bzw. Kennung (Kokarde) der japanischen Luftwaffe (Luftselbstverteidigungsstreitkräfte, \"Japan Air Self-Defense Force\") an der Seitenflosse und den beiden Tragflächen. Die Maschinen tragen die militärischen Kennungen 20-1101 bzw. 20-1102 und besitzen hochmoderne Kommunikationstechnik, deren Art und Umfang jedoch unbekannt ist; weitere Details wurden ebenfalls nie veröffentlicht. Diese beiden Flugzeuge sind der Modellversion nach die weltweit modernsten 747-Regierungsmaschinen. Des Weiteren benutzen die Regierungen von Bahrain, Brunei, Oman, Katar, Saudi-Arabien, Südkorea und Indien das Flugzeug. Die Argentinische Regierung mietet für die Auslandsreisen der Präsidentin eine Boeing 747-200 der Aerolíneas Argentinas an. Das ist notwendig, da das eigentliche Staatsflugzeug nicht über genügend Reichweite verfügt. Dazu wird das Rufzeichen auf T-01 abgeändert und die Maschine mit dem Staatswappen versehen. Der Prototyp der Boeing 747 steht im Museum of Flight in Seattle. Eine Boeing 747-100 der Air France findet man im Musée de l\'Air et de l\'Espace am Pariser Flughafen Le Bourget. Im Technik-Museum Speyer befindet sich die ehemalige Boeing 747-200 „Schleswig-Holstein“ der Lufthansa. Die auf den Stand der Boeing 747-300 gebrachte Version 200 \"Louis Blériot\" der KLM wird im Aviodrome am Flughafen Lelystad ausgestellt. Eine Boeing 747-238B („City of Bunbury“) der Qantas Airways findet man im Qantas Founders Outback Museum in Longreach. Je eine 747SP und eine 747-200 befinden sich im Museum der South African Airways in der Nähe von Johannesburg. Des Weiteren befindet sich eine zum Hostel umgebaute 747-200 der ehemaligen Fluggesellschaft Transjet auf dem Flughafen in Stockholm.'),(38,'Boeing 767',' Die Boeing 767 ist ein zweistrahliges Großraumflugzeug des US-amerikanischen Flugzeugherstellers Boeing. Der Tiefdecker war das erste Langstreckenflugzeug von Boeing mit zwei Triebwerken. Der Flugzeugtyp ist wirtschaftlich sehr erfolgreich und befindet sich noch in Produktion. Die Geschichte der Boeing 767 als Großraumflugzeug beginnt am 14. Juli 1978 mit der Bestellung von United Airlines über 30 Stück. Sie war als Ersatz für die Boeing 707 vorgesehen. Die Konstruktionsarbeiten begannen am 6. Juli 1979. Der Erstflug fand am 26. September 1981 in der Version 767-200 statt. Die Boeing 767 teilt sich viele Komponenten mit der gleichzeitig entwickelten Boeing 757. Eine verlängerte Ausführung, die 767-300, folgte Mitte der 1980er Jahre. Die Entwicklung begann im September 1983; 1986 konnte das erste Flugzeug an den Erstkunden Japan Airlines ausgeliefert werden. Den beiden Erstversionen folgte jeweils eine Variante mit vergrößerter Reichweite, die man an dem Kürzel \"„ER“\" für „\"E\"xtended \"R\"ange“ erkennen kann. Anfang des Jahres 1993 folgte noch eine Frachtvariante auf Basis der 767-300 mit dem Namen Boeing 767-300F. Diese ist bis heute die einzig ab Werk lieferbare Frachtversion der Boeing 767, allerdings werden Flugzeugzellen ausgemusterter Passagierflugzeuge zu Frachtern umgerüstet. Obwohl mit dem Airbus A310 von Airbus fast gleichzeitig ein Wettbewerbsprodukt am Markt platziert wurde, verkaufte sich die 767 bis zur Einführung des Airbus A330 sehr gut. Die A330 besetzte das gleiche Marktsegment, stellte jedoch eine völlig neue Flugzeuggeneration dar. Durch die erreichte höhere Wirtschaftlichkeit sowie den größeren Komfort durch den größeren Rumpfquerschnitt wurden für die A330 wesentlich mehr Aufträge gezeichnet als für die Boeing 767. Als Reaktion wurde die stark überarbeitete Ausführung Boeing 767-400ER entwickelt. Diese stellt eine nochmalige Verlängerung der Grundversion Boeing 767-200 dar und wurde statt der ebenfalls vorgeschlagenen Boeing 777-100 entwickelt. Am 9. Oktober 1999 hob das erste Flugzeug dieser Variante ab. Doch diese Version war zu sehr auf die Bedürfnisse des US-amerikanischen Marktes ausgerichtet worden und erreichte nicht die Reichweite der A330, weswegen der Markterfolg ausblieb. Daher beschloss Boeing 2004, mit der Boeing 787 ein völlig neues Flugzeug auf den Markt zu bringen, das die Boeing 767 mittelfristig ablösen soll. Anfang 2009 rüsteten American Airlines als erste Fluggesellschaft ihre Boeing 767-300ER mit Winglets nach. Ende März 2009 folgte Austrian Airlines als erste europäische Fluggesellschaft. Die Boeing 767 hat bis heute mehr Transatlantikflüge durchgeführt als jedes andere Passagierflugzeug. Bei der gemeinsamen Entwicklung wurde (zur Erzielung von Synergieeffekten) auf größtmögliche Gemeinsamkeiten der „Schwestermodelle“ Boeing 757/767 geachtet. Deshalb sind die beiden Modelle strukturell ähnlich und können wegen der fast gleichen Avionik von Piloten mit demselben Type Rating geflogen werden, da sich die beiden Cockpits zu 90 % gleichen. Diese Gemeinsamkeiten führen zu geringeren Trainings- und Wartungskosten, wenn beide Flugzeugtypen innerhalb einer Fluggesellschaft eingesetzt werden. Im Gegensatz zur 767 ist die 757 jedoch kein Großraumflugzeug. Überdies besitzt das Cockpitlayout der Boeing 767-200/-300 Ähnlichkeiten mit dem der „klassischen“ Boeing-737-Versionen. Mit der Boeing 767-400ER führte Boeing ein neues Cockpit in die Boeing-767-Reihe ein. Dieses Cockpit soll nach geringfügigen Umschulungen für die Crew genauso einfach zu benutzen sein wie das „Standard-Cockpit“ der 757/767-Familie, orientiert sich jedoch an dem Cockpit der Boeing 777. Heckbereich einer Boeing 767-300 von British Airways. Gut zu sehen ist der Auslass des Hilfstriebwerks Die Boeing 767 wurde und wird mit verschiedenen Triebwerken angeboten. Ursprünglich waren lediglich das JT9D-7R4 von Pratt & Whitney und das CF6-80A von General Electric verfügbar. Noch für die ursprünglichen Varianten der 767, der 200 und 300, lieferten \"Pratt & Whitney\" und \"General Electric\" verbesserte Triebwerke vom Typ PW4062 respektive \"CF6-80C2B7F\". Die neueren Versionen – 200ER, 300ER und 300F – wurden von Anfang an ausschließlich mit den verbesserten Triebwerken ausgeliefert. Mit dem RB.211-524H von Rolls-Royce wurde zudem eine dritte Triebwerksoption in das Programm aufgenommen, welche allerdings nur von British Airways und China Yunnan Airlines bestellt wurde. Für die größte Variante 767-400ER schließlich mussten stärkere Triebwerke entwickelt werden, welche bei \"General Electric\" mit \"CF6-80C2B8F\" einen eigenen Namen erhielten. Von \"Rolls-Royce\" ist für die 400ER kein Triebwerk erhältlich. Heute werden alle drei Typen nur noch in der ER-Version angeboten. \"ER\" steht dabei für \"Extended Range\" (größere Reichweite). Die als letztes entwickelte 767-400 nimmt dabei eine Sonderstellung ein, da eine Version ohne den ER-Zusatz nie gebaut wurde. Die größere Reichweite wird in erster Linie durch größere Treibstofftanks erreicht. Abgesehen von der Reichweite unterscheiden sich die drei Versionen durch unterschiedliche Längen und Spannweiten. Daneben gibt es noch eine Frachtversion, die 767-300F. Eine weitere Cargovariante mit dem Namen Boeing 767-200LRF (\"L\"ong \"R\"ange \"F\"reighter) wird derzeit konzeptionell verfolgt; auf ihr würde die geplante neue Version der militärischen KC-767 aufbauen. Die Boeing 767-200 war das erste Modell der Baureihe. Das erste Flugzeug wurde am 14. Juli 1978 bestellt. Bereits drei Jahre später fand die Rollout-Zeremonie am 4. August 1981 statt. Der erste Prototyp des Musters hob am 26. September 1981 ab. Am 30. Juli 1982 wurde das Flugzeug zertifiziert, am 19. August wurde das erste Serienflugzeug an den Erstkunden United Airlines übergeben, der den Flugbetrieb am 8. September aufnahm. Am 24. Februar 1994 wurde das letzte Flugzeug dieses Modells ausgeliefert. Die Boeing 767-200 wird als Mittelstreckenflugzeug eingesetzt und bietet in der Standardbestuhlung Platz für 224 Passagiere, davon 18 in der ersten Klasse mit 2+2+2 Sitzreihen und 96,5 cm Sitzabstand. Die restlichen Sitze sind im Schema 2+3+2 mit einem Sitzabstand von 81 cm angeordnet. Insgesamt gibt es fünf Toiletten, zwei im hinteren Rumpf, zwei in der Mitte der Hauptkabine und eine im vorderen Bereich der ersten Klasse. Ein Einklassenkabinenlayout ergibt ein Sitzplatzangebot für 255 Passagiere. Eine hochdichte Bestuhlung mit 2+4+2 Sitzreihen und 76 cm Sitzabstand erlaubt eine Passagierzahl von 290, erfordert aber 2 zusätzliche Notausgänge über den Flügeln. Diese Ausführung wurde den Fluglinien angeboten, jedoch nie produziert. Ein Dreiklassenlayout ergibt eine Sitzplatzkapazität von 181 Passagieren, davon 15 in der First Class mit 2+1+2 Sitzreihen bei einem Sitzabstand von 152 cm, 40 in der Business Class mit 2+2+2 Reihen und einem Sitzabstand von 91 cm. Der mittlere Raum für das Handgepäck beträgt 0,08 m³ pro Passagier. Er befindet sich in schließbaren Behältern über den Sitzen. Als Variante mit erhöhter Reichweite (englisch: \"E\"xtended \"R\"ange) wird die Boeing 767-200ER angeboten. Die erste Bestellung wurde am 16. Dezember 1982 durch Ethiopian Airlines aufgegeben. Die 767-200ER führte ihren Erstflug am 6. März 1984 durch, bereits am 26. März wurde das erste Flugzeug an El Al ausgeliefert. Als erstes wirkliches zweistrahliges Langstreckenflugzeug (neben dem Airbus A310) brach sie einige Langstreckenrekorde und legte durch ihre Zuverlässigkeit die Basis für die heutzutage normalen Transatlantikflüge mit lediglich zwei Triebwerken (ETOPS). Die maximale Reichweite liegt bei 12.200 Kilometern. 1988 stellte eine Boeing 767-200ER der Air Mauritius einen neuen Streckenrekord für Twinjets auf der Strecke Halifax–Mauritius mit 14.042 km auf. Dieser wurde erst durch die Boeing 777 gebrochen. Die Boeing 767-200SF ist eine von Passagier- in Frachtmaschine umgebaute 767-200. Eine weitere Version der SF ist die BDSF, die derzeit nur von UPS Airlines und ABX Air eingesetzt. Die BDSF basiert auf der 767-200ER. Die Boeing 767-300 ist eine gestreckte Version der Boeing 767-200. Dabei wurde eine 3,07 m lange Sektion vor dem Flügel und eine von 3,35 m hinter dem Flügel ergänzt. Zusätzlich wurde das Fahrwerk verstärkt, und einige Teile des Rumpfes und des Flügels wurden aus dickerem Material gefertigt. Das Abfluggewicht blieb gleich wie bei der 767-200. Die Entwicklung dieser Variante wurde im Februar 1982 bekannt gegeben, die erste Bestellung auf das Flugzeug gab Japan Airlines am 29. September 1983 auf. Der Roll-Out fand am 14. Januar statt, der Erstflug der 767-300 am 30. Januar 1986 mit JT9D-Triebwerken. Am 22. September war das Flugzeug mit JT9D- und CF6-Triebwerken zertifiziert. Japan Airlines übernahm das erste Modell am 25. September 1986 und setzte es ab dem 20. Oktober im Flugbetrieb ein. Die Boeing 767-300 wird als Langstreckenflugzeug eingesetzt. Die Reichweite beträgt bis zu 9700 Kilometern. Dies genügt für transatlantische Verbindungen, eine der Standardrouten für diese Version. Die 767-300 bietet in der Standardbestuhlung Platz für 269 Passagiere, davon 24 in der ersten Klasse mit 2+2+2 Sitzreihen und 96,5 cm Sitzabstand. Die restlichen Sitze sind in einem 2+3+2-Schema mit einem Sitzabstand von 78,7 cm angeordnet. Insgesamt gibt es sechs Toiletten. Ein Einklassenkabinenlayout ergibt ein Sitzplatzangebot von 286 Passagieren mit 81 cm Sitzabstand. Eine hochdichte Bestuhlung mit 71 cm Sitzabstand erlaubt eine Passagierzahl von 350. Alle Kabinenlayouts für mehr als 290 Passagiere erfordern zusätzliche Notausgänge. Ein Dreiklassenlayout ergibt eine Sitzplatzkapazität von 218 Passagieren, davon 18 in der First Class mit 2+1+2 Sitzreihen bei einem Sitzabstand von 152 cm, 46 in der Business Class mit 2+2+2 Reihen und einem Sitzabstand von 91 cm. Die Boeing 767-300ER ist eine Version der 767-300 mit größerer Reichweite und dem zusätzlichen Rumpftank, wie er auch in der 767-200ER eingebaut ist. Die Entwicklung begann im Januar 1985. Der Erstflug der 767-300ER fand am 19. Dezember 1986 statt, Erstkunde war American Airlines, die am 3. März 1987 15 Flugzeuge bestellt hatte. Den Flugbetrieb nahm die 767-300ER am 3. März 1988 bei American Airlines auf, nachdem die erste Maschine am 19. Februar 1988 ausgeliefert worden war. Die Bestuhlungsmöglichkeiten entsprachen denen der 767-300. Das Startgewicht konnte optional auf 172.365 kg angehoben werden. Ab 1992 war auch ein Startgewicht von 186.880 kg zulässig. Die Boeing 767-400ER ist eine gegenüber der 767-300 nochmals verlängerte Version der 767. Dazu wurde jeweils ein 3,36 m langes Kabinenstück vor dem Tragflügel und ein 3,07 m langes Stück dahinter eingefügt. Die Konstruktion der 767-400ER begann 1996, ab Januar 1997 wurde das Modell angeboten. Mit der Boeing 767-400ER können bis zu 375 Passagiere über eine Strecke von maximal 10.547 Kilometern transportiert werden. Die normale Bestuhlung in einem 3-Klassenlayout ermöglicht den Transport von 245 Passagieren, bei einem 2-Klassenlayout sind es 304 Passagiere. Die Boeing KC-767 ist eine Ausführung der Boeing 767 als Tank- und Transportflugzeug auf Basis der zivilen 767-200 oder 767-300. Die Maschine verfügt über einen starren Tankausleger (Flying Boom) von Boeing, der von einem Bediener im Heck der Maschine gesteuert wird, und zwei Schlauchausleger von Smith Aerospace. Im Juni 2000 wurden umfangreiche Versuche mit einer umgebauten 767 erfolgreich durchgeführt. Die Gesamtkraftstoffkapazität beträgt 112.578 Liter. Zusätzlich können auf dem Hauptdeck 18 Paletten vom Typ 463L oder 216 Personen befördert werden. Weitere Güter können im Unterdeck transportiert werden. Die drei bisherigen Kundennationen sind alle am Bau der 767 beteiligt (siehe Abschnitt 2). Am 24. Februar 2011 gewann Boeing im dritten Anlauf der Ausschreibung den Auftrag über 179 Tankflugzeuge KC-46A, basierend auf der Boeing 767. Die als „Jahrhundertauftrag“ bezeichnete Ausschreibung wird auf 35 Milliarden USD beziffert. Inklusive künftiger Service- und Folgeaufträge – es müssen rund 500 KC-135 ersetzt werden – könnte das Auftragsvolumen insgesamt auf etwa 100 Milliarden USD steigen. Die IAI 767 MMTT ist die Tankerversion der Boeing 767-200ER. Der Multi Mission Tanker Transport befindet sich zurzeit in der Erprobung. Der Tanker wurde von Israel Aircraft Industries für Kolumbien entwickelt und soll um die Jahreswende 2010 ausgeliefert werden. Die Maschine ist mit zwei eigenentwickelten Schlauchbehältern APR-3 ausgerüstet. Diese Behälter können bis zu 1500 Liter Kerosin in der Minute abgeben. In der langen Einsatzzeit der Boeing 767 kam es zu mehreren Zwischenfällen; bei elf Unfällen musste die Flugzeugzelle aufgegeben werden, insgesamt starben dabei 851 Personen. Da zwei Boeing 767 bei den Terroranschlägen am 11. September 2001 in das World Trade Center geflogen wurden, verursachten sie weitere 2142 Tote. Bei fünf Unfällen gab es keine Personenschäden mit tödlichem Ausgang, wobei zwei 767 bei Kriegshandlungen zerstört wurden. Insgesamt gab es 32 Entführungen und größere Zwischenfälle. Bis November 2010 wurden insgesamt 1.044 Boeing 767 aller Baureihen bestellt, davon sind bisher 992 ausgeliefert worden.'),(40,'Fokker 70',' Die Fokker 70 ist eine verkürzte Variante der Fokker 100 für bis zu 79 Passagiere und konnte somit als Nachfolger der Fokker F-28 dienen. Offiziell vorgestellt wurde die Fokker 70 im Juni 1993, als 15 Festbestellungen vorlagen. Der erste Prototyp der Fokker 70 war der um zwei Rumpfsektionen (eine vor und eine hinter dem Flügel) verkürzte zweite Prototyp der Fokker 100, was deren Gesamtlänge um 4,62 m reduzierte. Die Triebwerksausstattung blieb mit dem Rolls-Royce Tay 620 Turbofan im Vergleich zur Fokker 100 unverändert. Der Flügel und das Cockpit sind ebenfalls unverändert, so dass gemischter Betrieb mit der Fokker 100 möglich ist. Der Erstflug des Prototyps war am 2. April 1993, der Beginn der Serienproduktion im Februar 1994 und der Erstflug der Serienmaschine fand am 12. Juli 1994 statt. Da der niederländische Hersteller Fokker im Februar 1996 in Konkurs ging, wurden nur 48 Maschinen des Typs Fokker 70 gebaut. Am 3. März 2011 verlor eine Fokker 70 der Austrian Airlines direkt nach dem Start und noch auf dem Flughafengelände in München eines der vier Räder. Nach Warteschleifen zur Reduzierung des Treibstoffs landete die Maschine nach rund einer halben Stunde wieder ohne weitere Probleme in München Lediglich ein Exemplar der Fokker 70 mit der Kennung \"PH-MKC\", das durch Fokker selbst betrieben wurde, ist bereits verschrottet worden.'),(41,'Fokker 100',' Die Fokker 100 ist ein zweistrahliges Passagierflugzeug der Fokker Flugzeugwerke mit einer Kapazität für etwa 100 Passagiere. Triebwerk einer Fokker 100 aus der Passagierkabine betrachtet Die Fokker 100 kam Ende 1986 auf den Markt. Der Erstflug erfolgte am 30. November 1986, die Maschine trug die Registrierung PH-MKH. Sie war eine Weiterentwicklung der Fokker F-28 Fellowship, von der sie sich durch einen gestreckten Rumpf, modernere Rolls-Royce Tay Triebwerke, neuere Systeme (wie EFIS) und aerodynamische Verbesserungen unterschied. Eine verkürzte Bauart der Fokker 100 wurde 1993 mit der Fokker 70 auf den Markt gebracht. Mit der Fokker F-28 Fellowship hatte Fokker einen modernen Regionaljet „erfunden“ und mit der Fokker 100 verbessert. Erstbestellerin Swissair setzte im Februar 1988 die erste Fokker 100 in Betrieb. American Airlines als größter Kunde betrieb 75 Einheiten. Doch mit dem Konkurs des Unternehmens Fokker 1996 verschwand dieses Modell vom Markt für Neuflugzeuge. Schon zuvor war der Flugzeugtyp durch die Boeing 737 und den Airbus A319 in eine Nische gedrängt worden. Auf dem Markt für Gebrauchtflugzeuge blieb die Fokker 100 jedoch begehrt, da beispielsweise US Airways einen Großteil seiner Fokker-100-Flotte stilllegte und diese damit günstig am Markt verfügbar waren. Die Fokker 100 steht seit 2003 bei der Germania im Dienst, welche ihre Maschinen an sogenannte \"Billigfluggesellschaften\" und Linienfluggesellschaften verleast. Die Austrian Airlines Group übernahm einige Maschinen aus Beständen der American Airlines. Bis 1996 wurden 278 Maschinen des Typs Fokker 100 gebaut, von denen gegen Ende 2005 die meisten als Regionalverkehrsflugzeug im aktiven Dienst standen. In diesem Bereich war die Fokker 100 sehr erfolgreich. Besonders in den USA konnte man viele Maschinen dieses Typs absetzen. Auch in Europa fand man zahlreiche Abnehmer, die auf dieses moderne Konzept eines Regionaljets setzten (z. B. KLM und Swissair). In Flugplänen wird die Fokker 100 meist mit F100 (ICAO-Code) oder 100 (IATA-Code) abgekürzt. Nachdem Ende 2010 ein Kredit in Höhe von knapp 20 Mio. Euro der Niederlande an die Firma Rekkof Aircraft N. V. gewährt wurde, will diese die Fokker 100 als XF100 in einer mit Winglets, neuer Avionik und neuen Triebwerken modernisierten Form auf den Markt bringen. Die erste XF100 soll Ende 2015 in Dienst gehen. Eine Fokker 100 der Blue Line'),(48,'Douglas DC-9',' Die Douglas DC-9 bzw. McDonnell Douglas DC-9 ist ein zweistrahliges Standardrumpfflugzeug des US-amerikanischen Flugzeugherstellers Douglas Aircraft Company (ab 1967: McDonnell Douglas). Es handelt sich um einen zweistrahligen Tiefdecker mit seitlich am Heck angebrachten Strahltriebwerken, einer Druckkabine, einem Einziehfahrwerk und einem T-Leitwerk. Die DC-9 wurde als Ergänzung zur DC-8 entwickelt und beruht auf den gemachten Erfahrungen, war allerdings eine völlige Neukonstruktion.'),(60,'McDonnell Douglas DC-10',' Die McDonnell Douglas DC-10 ist ein dreistrahliges Langstreckenflugzeug des US-amerikanischen Flugzeugbauers McDonnell Douglas. Am 29. August 1970 fand der Erstflug dieses Flugzeugmusters von Long Beach, Kalifornien zur Edwards Air Force Base statt. Dreistrahler wurden vor der Entwicklung von ETOPS-Strahltriebwerken auf Strecken eingesetzt, für die vierstrahlige Maschinen unrentabel waren. Die DC-10 war daher für lange Zeit nach der Boeing 747 das zweithäufigste und zweitschwerste Großraumflugzeug. Sie geht einerseits durch ihre Langlebigkeit und andererseits durch eine Unfallserie in den späten 1970er Jahren in die Geschichte der Zivilluftfahrt ein.'),(75,'Bombardier Q Series',' Die Bombardier Q Series, früher \"de Havilland Canada DHC-8\" oder \"Dash 8\" genannt, ist eine zweimotorige Turboprop-Regionalflugzeug-Familie. Sie wurde Anfang der 1980er Jahre vom Flugzeughersteller de Havilland Canada entwickelt. Heute wird die Dash 8 vom Unternehmen Bombardier Aerospace gefertigt, das im Jahr 1992 DHC von Boeing erwarb und als Tochtergesellschaft in seinen Konzern eingliederte.'),(228,'Airbus-A320-Familie',' Als Airbus-A320-Familie werden die vier Standardrumpfflugzeug-Baureihen des Flugzeugherstellers Airbus bezeichnet. Die A320 ist dabei als erste Variante das Basismodell der als Tiefdecker ausgeführten A320-Familie, zu der auch die beiden kürzeren Modelle A318 und A319, sowie eine gestreckte Version namens A321 gehören. Die Namen der einzelnen Modelle orientieren sich an der jeweiligen Länge des Rumpfes. Die einzelnen Mitglieder sind Mittelstreckenflugzeuge für die kommerzielle Passagierluftfahrt. Die erste A320 wurde 1988 ausgeliefert. Sie war das erste zivile Flugzeug mit rein digitaler Fly-by-Wire-Steuerung. Die ausführliche und aktuelle Auflistung der Bestellungen und Auslieferungen der Airbus-A320-Familie findet sich auf der Website von Airbus.'),(232,'Embraer-ERJ-145-Familie',' Die Embraer-ERJ-145-Familie (ERJ steht für „Embraer Regional Jet“) besteht aus Regionalverkehrsflugzeugen, die vom brasilianischen Flugzeughersteller Embraer produziert werden. Die Mitglieder sind der ERJ 135, der ERJ 140, der ERJ 145 und das Businessflugzeug Legacy. Die Flugzeugfamilie gehört zu den meistproduzierten Regionalflugzeugen der Welt und ist der wohl größte Konkurrent zum Bombardier Canadair Regional Jet.'),(301,'Boeing 777',' Die Boeing 777, oft auch als \"Triple Seven\" bezeichnet, ist ein zweistrahliges Großraum-Langstreckenflugzeug von Boeing für 300 bis 550 Passagiere. Sie ist das größte zweistrahlige Verkehrsflugzeug der Welt und durch die ETOPS-Zertifizierung auch für Interkontinentalstrecken geeignet. Die Varianten der Boeing 777 unterscheiden sich in Länge und Reichweite deutlich. Der Erstflug der Grundversion Boeing 777-200 fand 1994 statt. Vergleichbare Modelle zur Boeing 777 sind der Airbus A330 und A340 sowie die Iljuschin Il-96. Mit Stand November 2010 wurden 896 von 1165 bestellten Flugzeugen dieses Typs ausgeliefert. Im Herbst 1990 fand der Entscheidungsprozess von United zum Ersatz der veralteten DC-10 seinen Abschluss. Drei Zellenhersteller und drei Triebwerksbauer trugen ihre Vorschläge bei einem gemeinsamen Treffen vor. Airbus präsentierte den A330 und McDonnell Douglas die MD-11. Das Team von United verbrachte 70 Stunden mit Verhandlungen und gab seine Entscheidung am 14. Oktober bekannt. Vom technischen Standpunkt her war das Projekt von Boeing, das jetzt Boeing 777 genannt wurde, der Gewinner; finanziell gesehen lag der Airbus A330 vorne. Zunächst wurden nur zwei Varianten angeboten, die Basisvariante Boeing 777-200 und eine Variante mit höherer Reichweite, aber auch höherem Gewicht: die Boeing 777-200IGW, die man später in Boeing 777-200ER umbenannte. Der Jungfernflug fand am 12. Juni 1994 statt. Die Boeing 777 ist das erste Flugzeug von Boeing, das mit Fly-by-wire-Technik (Steuerungstechnik) ausgerüstet ist. Es werden auch vermehrt Verbundwerkstoffe eingesetzt, um das Gewicht zu verringern. Deutlichstes optisches Erkennungsmerkmal der Maschine ist das dreiachsige Hauptfahrwerk. Bei anderen Flugzeugen mit ähnlichem Gewicht wird hier eine zusätzliche Fahrwerksgruppe verwendet. Die 777-200 ist das Basismodell der 777-Familie. Der Erstflug des Prototyps fand am 12. Juni 1994 statt. United Airlines war Erstkunde der Boeing 777 mit 34 Festbestellungen und ebenso vielen Kaufabsichtserklärungen. Erst nach einer weiteren Bestellung (von ANA) wurde das 777-Programm offiziell gestartet. Die 777-200 wurde eine Zeit lang mit einklappbaren Flügelspitzen angeboten. Diese verringern die Größe der am Boden benötigten Parkposition. Da aber niemand diese Option bestellte, wurde sie schnell wieder fallen gelassen. Die 777-200 ist für Triebwerke von Pratt&Whitney, Rolls-Royce und General Electric zugelassen. Die Basisvariante der 777 ist ein Langstreckenflugzeug für 305 bis 440 Passagiere, ihre Länge beträgt 63,73 m, ihre Spannweite 60,93 m und ihre Reichweite 9.700 km. Eine Startmasse von 263.090 kg macht die 777-200 zu einem schweren Flugzeug, bei dem die Pisten jedoch nicht verstärkt werden müssen. Die erste Maschine wurde im April 1995 in Dienst gestellt. Am 2. April 1997 flog eine neue Boeing 777-200 IGW (IGW für „increased gross weight“ – erhöhtes Startgewicht; später 777-200ER) der Malaysia Airlines im Überführungsflug vom Boeing-Werksflughafen in Seattle (Washington, USA) nach Kuala Lumpur (Malaysia) und brach damit den Rekord für den längsten Non-Stop-Flug Richtung Osten. Die Strecke betrug 20.044 km und die Flugzeit 21 Stunden und 23 Minuten. Sie verlor den Rekord am 10. November 2005 an eine Boeing 777-200LR (siehe unten). Gleichzeitig mit der Boeing 777-300ER wurde im Januar 2000 die Entwicklung der 777-200LR (LR für „longer range“ – größere Reichweite) dieses Typs beschlossen, nach den Ereignissen am 11. September 2001 jedoch zunächst für einige Zeit zurückgestellt. Im August 2004 begann der verzögerte Bau der ersten Boeing 777-200LR, die ihren Roll-Out am 15. Februar 2005 hatte. Der Erstflug fand am 8. März 2005 statt, ein zweiter Prototyp folgte am 24. Mai 2005. Die Boeing 777ER-Modelle konkurrieren mit den vierstrahligen Airbus A340 und Iljuschin Il-96 und der in der Entwicklung befindlichen zweistrahligen Airbus A350, die Modelle ohne ER mit dem zweistrahligen Airbus A330. Große Boeing-777-Flotten betreiben unter anderem Emirates, Singapore Airlines, United Airlines, American Airlines, British Airways, All Nippon Airways, Japan Airlines, Thai Airways International, Air France, Etihad Airways, Cathay Pacific, Air Canada, Air India, Turkish Airlines und Korean Air Am 17. November 2010 wurde die 900. Boeing 777 ausgeliefert, eine \"-200LR\" für Ethiopian Airlines.'),(316,'Boeing 737',' Die Boeing 737 ist die meistgebaute Familie von zivilen strahlgetriebenen Passagierflugzeugen. Die als Standardrumpfflugzeug ausgelegte Familie wird vom US-amerikanischen Hersteller Boeing in der mittlerweile dritten Generation gefertigt und hat über die Zeit ihre äußere Erscheinung kaum geändert. Ursprünglich als kleines Kurzstreckenflugzeug geplant, ist die jüngste Generation „Boeing 737 Next Generation“ eine Familie von Mittelstreckenflugzeugen für die kommerzielle Passagierluftfahrt, deren Spektrum grob vom 100-Sitzer 737-600 bis zum 200-Sitzer 737-900ER reicht. Auch Langstrecken können mittlerweile mit bestimmten Varianten bedient werden. Die erste Auslieferung einer Boeing 737 erfolgte im Dezember 1967, als eine Boeing 737-100 an die Lufthansa übergeben wurde. Bis heute findet die Boeing 737 mit über 8.800 (Stand: 31. Dezember 2010) Bestellungen einen sehr guten Absatz. Zur Zeit (Stand: 2005) sind weltweit stetig rund 1.300 Boeing 737 gleichzeitig in der Luft, wobei ca. jede sechste Sekunde eine 737 startet. Die größte Konkurrenz für die Boeing 737 stellt die Airbus-A320-Familie dar, die zwar erst während der späten 1980er-Jahre auf den Markt kam, sich aber mittlerweile mit 6.528 Bestellungen (Stand Dezember 2009) durchschnittlich besser verkauft. Die aktuellen Listenpreise der Boeing 737 betragen ohne Rabatt zwischen 50 Millionen US-Dollar für die kleinste Version (737-600) und 74 Millionen US-Dollar für die größte (737-900ER), Sonderausstattungen jeweils nicht mitgerechnet. Die Cockpitansicht einer frühen Boeing 737-130... ... und einer aktuellen Boeing 737-800 Die erste Boeing 737, eine Boeing 737-100, hob am 9. April 1967 zu ihrem Erstflug ab und wurde im Februar des folgenden Jahres bei der Lufthansa in den Dienst gestellt. Es wurden jedoch lediglich 30 Exemplare gebaut, nahezu alle wurden an die Lufthansa geliefert. Weitaus erfolgreicher war die verlängerte Version 737-200, die am 8. August 1967 ihren Erstflug absolvierte und bis 1988 produziert wurde. Der Erstkunde für diese Variante war die United Airlines, die das Flugzeug ab dem 28. April 1968 einsetzte. Wie die Boeing 747 („Jumbo“) besitzt auch die Boeing 737 einen international gebräuchlichen (aber weit weniger bekannten) Spitznamen. In Fliegerkreisen wird die Boeing 737 „Bobby“ genannt. Dieser Name, der eher im deutschsprachigen Raum bekannt ist, entstand im Lufthansa-Konzern. Dort gab es für die kleinen Passagiere in der Zeit von 1970 bis 1972 ein Buch, das den Titel „Bobby Boeings Abenteuer“ trug. Passagierkabine einer aktuellen Boeing 737-800 der Delta Für die Boeing 737 läuft die Zeit jedoch unweigerlich ab, unter dem Projektnamen \"Boeing Y1\" verfolgt Boeing bereits Pläne für den Nachfolger der Flugzeugfamilie. Diese wird Boeings nächstes großes Projekt nach der 787 sein. Zuvor wird die 737 aber noch von Verbesserungen des CFM-56-Triebwerkes profitieren. Im Mai 2008 verkündet Boeing, dass es frühestens im Jahr 2015 einen Nachfolger für die 737 geben wird. Der Rumpf einer Boeing 737 auf dem Weg nach Renton zur weiteren Montage Zwischen März 1981 und März 1982 wurden alle Maschinen der Lufthansa weiterverkauft, die meisten von ihnen übernahm People Express. Von der Boeing 737-100 wurden insgesamt 30 Stück hergestellt. Eine Boeing 737\"-200\" der Air North Die Boeing 737-200 ist die verlängerte Version der 737-100, die ursprünglich vor allem dem US-Markt angepasst war. Der Erstkunde für dieses Flugzeug war United Airlines. Die 737-200C (C für Convertible) ist eine Version der 737-200, die sowohl für Passagier- als auch für Frachtzwecke verwendet werden kann; der Erstkunde für diese Variante war Wien Air Alaska. Die Boeing 737-200 ist 30,53 Meter (ca. 100 Fuß) lang und ebenfalls noch mit JT8D-Triebwerken von Pratt & Whitney ausgestattet. Von dieser Version wurden knapp 1.100 Stück gebaut. Die Boeing 737-200 Advanced ist eine Weiterentwicklung der 737-200 mit den gleichen Abmessungen, jedoch mit einer erhöhten Leistung. Sie weist eine größere Reichweite bei vergrößerter Zuladungskapazität auf und kann auf kürzeren Start- und Landebahnen operieren. Zudem wurden die Triebwerke in Bezug auf Verbrauch und Lärmentwicklung optimiert. Signifikant ist auch eine bedeutende Weiterentwicklung der Avionik. Die Boeing 737-200 wurde bis 1988 hergestellt. Die Triebwerke weisen eine längliche Form auf und deshalb kann die Maschine auf Flughäfen gut ausfindig gemacht werden. Von den klassischen Versionen Boeing 737-300, -400 und -500 wurden 1984 bis 1999 1.988 Stück produziert. Aufgeschlüsselt nach Typen waren das 1.113 Stück 737-300, 486 Stück 737-400 sowie 389 Stück 737-500. Die Boeing 737-300 war ursprünglich ein etwas längeres Schwestermodell der Boeing 737-200, wurde dann aber das neue Basismodell der klassischen 737. Sie bekam das moderne CFM56-3-Triebwerk von CFMI, hatte bereits Bildschirme im Cockpit und ein Flight Management System. Diese Version erhielt eine Zulassung für bis zu 150 Sitzplätze. Die Reichweite beträgt bei maximaler Zuladung 2.500 km. Sie wurde in 1.113 Exemplaren gebaut. Erstkunden dieses Typs waren Southwest Airlines und USAir. Einige Maschinen wurden später bei externen Firmen auch mit einer seitlichen Frachttür und schnell demontierbaren Passagiersitzen ausgestattet, was eine schnelle Umrüstung zwischen Fracht- und Passagierbetrieb ermöglichte. Diese erhielten dann die inoffizielle Bezeichnung B737-300QC (für QuickChange). Eine Boeing 737\"-400\" der Czech Airlines Im Juni 1986 wurde bekannt, dass Boeing die 737 nochmals verlängern und eine 400er-Variante auf den Markt bringen würde. Sie bot nun bis zu 174 Passagieren Platz, schloss damit zum größeren Airbus A320 auf und ersetzte die 727. Sie wurde speziell für Charterfluggesellschaften entwickelt. Diese Version war die größte klassische Boeing 737. Die 737-400 absolvierte am 19. Februar 1988 ihren Erstflug und trat im Oktober dieses Jahres bei Piedmont Airlines ihren Dienst an. Insgesamt wurden von dieser Version 486 Stück ausgeliefert. Die letzte Boeing 737 Classic (Boeing 737-400) wurde am 28. Februar 2000 an ?SA übergeben. Eine Boeing 737\"-500\" der Estonian Air Die Boeing 737-500 ist eine verkürzte Version mit der Länge der Boeing 737-200, aber der modernen Technik der -300 und -400. Das Projekt wurde im Mai 1987 unter dem Namen 737-1000 vorgestellt, erhielt dann jedoch den heute gültigen Versionsnamen. Der Erstflug fand am 30. Juni 1989 statt, die erste Auslieferung erfolgte im Februar 1990 an den Erstkunden Southwest Airlines. Die Boeing 737-600 ist eine verkürzte Version mit der Länge der Boeing 737-200/-500, aber der modernen Technik der Next-Generation-Modelle. Die Entwicklung der 737-600 wurde am 16. März 1996 gestartet, der Erstflug fand am 22. Januar 1998 statt. Die erste Auslieferung folgte im September desselben Jahres an SAS. Eine Boeing 737\"-700\" der Aeroméxico mit Winglets Die Boeing 737-700 war die erste Version der „Next Generation“ (NG) und entspricht in der Länge etwa der Boeing 737-300. Sie wurde im November 1993 als erste 737NG vorgestellt, der Roll-Out fand am 7. Dezember 1996 statt. Die Zertifikation folgte im November 1997, worauf dann im Dezember der Erstkunde Southwest Airlines den Flugdienst mit der 737-700 aufnahm. Aktuell wurden insgesamt 1511 Einheiten bestellt und 994 ausgeliefert. Eine Maschine kostet derzeit zwischen 57 und 67,5 Millionen US-Dollar.(Stand: Dezember 2008). Die Boeing 737-700C (C = Convertible) ist eine Version der Boeing 737-700, die mit einer „Quick-Change“-Option in weniger als einer Stunde von einem Passagierflugzeug in ein Frachtflugzeug umgebaut werden kann (oder umgekehrt). Sie verfügt über die verstärkten Tragflächen der Boeing 737-BBJ. In einer Ein-Klassen-Konfiguration können bis zu 140 Passagiere befördert werden, die Zwei-Klassen-Konfiguration bietet Platz für bis zu 126 Passagiere. In der Frachtversion können bis zu 18.780 kg Fracht über 5335 km (2880 nm) befördert werden. Die Boeing 737-700C ist mit einer neu entwickelten Frachttür im Hauptdeck ausgerüstet. Die ersten beiden Vollfrachter wurden am 3. September 1997 von der United States Navy bestellt. Die militärische Variante wird C-40 Clipper genannt. Insgesamt zwölf Einheiten wurden an drei Kunden ausgeliefert (Stand: Juli 2009) Eine Boeing 737\"-800\" der Austrian Airlines mit Winglets Die Boeing 737-800 ist etwas länger als die 737-400 (39,5 m lang, 12,5 m hoch, 35,79 m Spannweite), optional mit den großen Winglets erhältlich, die eine Höhe von 2,60 Meter haben, und kann maximal 189 Passagiere befördern. Das Projekt wurde am 5. September 1994 unter dem Namen „737-400X Stretch“ gestartet. Der Erstflug erfolgte am 31. Juli 1997, im April 1998 wurde das erste Flugzeug der Hapag-Lloyd Flug (heute TUIfly) übergeben. Von Hapag-Lloyd stammte auch die Forderung nach einer Reichweitenerhöhung. Die Fluggesellschaft forderte im Pflichtenheft, die Strecke Hannover–Kanaren vollbesetzt ohne Tankstopp fliegen zu können. Für Varig wurde die Variante SFP (Special Field Performance) entwickelt, um auf der nur 1350 m kurzen Piste des Flughafen Rio de Janeiro-Santos Dumont zu starten. Nach dem Brand der Boeing 737-800 der China Airlines am 20. August 2007 in Okinawa wurde von der FAA und der EASA angeordnet, dass alle Maschinen dieses Typs innerhalb von zehn Tagen auf lose Führungsstifte in der Tragflächenvorderkante untersucht werden müssen. Einen Monat später, am 21. September 2007 entdeckten Mechaniker erneut bei einer Boeing 737-800 der China Airlines einen 70 cm langen Haarriss in der Nähe des Hecks. Untersuchungen seitens japanischer Behörden wurden eingeleitet. Eine Boeing 737\"-900ER\" der Futura mit Winglets Die Boeing 737-900 ist die bisher größte aller Boeing 737. Die maximale Anzahl ihrer Passagiersitze wurde auf 189 limitiert, da die Anzahl der Notausgänge gegenüber der Boeing 737-800 nicht erhöht wurde. Für Mehrklassen-Bestuhlungen stellt die Begrenzung kein Problem dar. Die Entwicklung wurde am 10. September 1997 mit einer Order über zehn Flugzeuge von Alaska Airlines gestartet. Der Erstflug fand am 3. August 2000 statt, das erste Flugzeug wurde am 15. Mai 2001 an Alaska Airlines übergeben. Nach 52 ausgelieferten Maschinen wurde die Produktion zu Gunsten der 737-900ER eingestellt. Eine Boeing 737-900ER kostet zwischen 74 und 85 Millionen US-Dollar. Fluggesellschaften haben insgesamt 256 Maschinen dieses Typs bestellt, von denen bisher 69 ausgeliefert wurden (Stand: März 2010). Auf Basis der Boeing 737NG entwickelte Boeing zusammen mit General Electric Geschäftsreiseflugzeuge, die heute unter dem Namen Boeing Business Jet, oder kurz BBJ, bekannt sind. Zur Zeit gibt es drei Modelle, die BBJ auf Basis der Boeing 737-700, die BBJ 2 auf Basis der Boeing 737-800 und die BBJ 3 auf Basis der Boeing 737-900ER. Durch den Einbau von bis zu neun Zusatztanks, so genannten \"Auxiliary Fuel Tanks\", wird aus der Boeing 737 ein Langstreckenflugzeug, das bei optimalen Bedingungen eine Reichweite von bis zu 11.480 km aufweist. Der serienmäßige Einbau von nach oben gebogenen Tragflächenenden (Winglets) ist ein weiteres Merkmal der BBJ. Der größte Unterschied zu den Passagierflugzeugen liegt jedoch in der Kabinenausstattung, die beispielsweise bei Jet Aviation, SR Technics und Lufthansa Technik auf Wunsch installiert werden kann. Die ursprüngliche BBJ ist ein Zwitter aus dem Rumpf der Boeing 737-700 kombiniert mit den strukturell verstärkten Tragflächen, der Tragflächenmittelsektion und dem verstärkten Fahrwerk der 737-800. Die Reichweite beträgt maximal 11.480 km. Auf Grund der großen Nachfrage bietet Boeing nun auch eine größere Version der BBJ an, die BBJ 2. Sie basiert auf dem kompletten Flugwerk der 737-800 und unterscheidet sich vor allem durch die Reichweite, die 10.460 km beträgt. Das dritte Modell basiert auf der 737-900ER (Extended Range) und bietet rund 11 % mehr Kabinenraum als das BBJ-2-Modell sowie rund 35 % mehr als die BBJ. Die BBJ 3 wird 104 m² Kabinenbodenfläche bieten und mit acht zusätzlichen Tanks eine Reichweite von 10.140 km haben. Am 17. Oktober 2006 wurde das Programm mit zwei nicht genannten Kunden offiziell gestartet.');
